import styled from "@emotion/styled";

export const OrderlistWrapper = styled('div')`
    position: relative;
    width: 100%;
    padding-top: 70px;

    .wrapper_inner {
        position: relative;
        width: 100%;
        display: flex;
        flex-direction: column;
        padding: 50px 75px;

        .page_head {
            position: relative;
            width: 100%;
            display: flex;
            justify-content: center;

            h2 {
                position: relative;
                font-family: 'Lemonada', cursive;
                font-size: 21px;
            }
        }
    }
`;
